import React from 'react';
import logo from './logo.svg';
import './App.css';
import axios from 'axios';

class Table extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      users: []
    }//super(props)
  }
  componentDidMount() {
    axios.get(`http://localhost:3000`)
      .then(res => {
        const users = res.data;
        this.setState({ users });
      })
  }
}
export default App;
